import styles from "./addUser.module.css";

function UserList(prop) {
  const formlist = (prop.forminfo.map = (user) => {
    <p>
      {" "}
      {user.userName} {user.age}
      console.log(porp.forminfo.userName);
    </p>;
  });
    
  return (
    <div className={styles.maindiv}>
      <form className={styles.usrform}>
        <lb className={styles.lblform}>{formlist}</lb>
      </form>
    </div>
  );
}

export default UserList;
